object Problem_0214 extends App {
  def time[R](block: => R): R = {
    val t0 = System.nanoTime()
    val result = block    // call-by-name
    val t1 = System.nanoTime()
    println("Elapsed time: " + (t1 - t0)/1000000 + "ms")
    result
  }

  def shortestPalindrome(s: String): String = {
    var res = s
    val s_reverse = s.reverse
    var i = 0; var j = s.length
    while (s_reverse.substring(i) != s.substring(0, j)) {
      i += 1
      j -= 1
    }
    s_reverse.substring(0, i) + s

//    //  Slow
//    var pos = 0
//    while (!(res == res.reverse)) {
//      res = s_reverse.substring(0, pos) + s
//      pos += 1
//    }
//    res
  }

  print(shortestPalindrome("a") + "\n")
  print(shortestPalindrome("ab") + "\n")

  print(shortestPalindrome("aacecaaa") + "\n")
  print(shortestPalindrome("abcd") + "\n")

  time(shortestPalindrome("") + "\n")
}
